Step-by-step reasoning:
1. Key psychological mechanisms:
 • Participants compare the received offer (split_self) with an expected “fair share.” The fair share is computed from their contribution relative to the opponent’s (token_self vs. token_opp) scaled by the combined earning.
 • A baseline bias (intercept) and a sensitivity to deviations from fairness combine to determine a utility for acceptance.
 • This utility is then transformed via a logistic function into an acceptance probability.

2. Interaction of mechanisms:
 • The closer the proposed share is to or exceeds the fair share, the higher the utility and thus the higher the chance of acceptance.
 • A negative utility (especially when the offer is less than the fair share) produces a probability below 50%.

3. Mathematical form:
 • Compute expected fair share: fair_share = (token_self / (token_self + token_opp)) * combined_earning.
 • Define utility U = base + sensitivity * (split_self – fair_share).
 • The acceptance probability p is given by the logistic transformation p = 1 / (1 + exp(–U)), and the binary decision follows a Bernoulli process.

4. Parameters:
 • base (intercept) is a learnable parameter with generous bounds (–10 to 10).
 • sensitivity is a learnable parameter (–10 to 10) that scales the fairness difference.
 • These two parameters are few in number, minimizing parameter covariance.

5. Mapping to behavior:
 • Data variables token_self, token_opp, combined_earning, and split_self determine the fairness discrepancy.
 • The logistic transformation of utility U yields the probability of acceptance, directly predicting the binary variable accept.

Below is the formal mathematical model and variable descriptions.

<MODEL>
U = base + sensitivity * (split_self - ((token_self / (token_self + token_opp)) * combined_earning))
p = 1 / (1 + exp(-U))
accept ~ Bernoulli(p)
